import express from 'express';
const app = express();
const port = 3000;

//localhost:5000/
const d = 8;
console.log(d);
function info(req, res) {
  const a = 123;
  const b = Math.random();
  const c = a + b;
  res.send('INFO here' + c);
}
function home(req, res) {
  res.send('LOCALCODING');
}
app.get('/', home);
app.get('/info', info);
app.listen(port, () => {
  console.log(`Example app listening at http://localhost:${port}`);
});

